import { Layout, Card, Text } from '@ui-kitten/components';
import React from 'react';

export default function QuestionCard({ text = 'test', status = 'info' }) {
  return (
    <Layout style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
      <Card status={status}>
        <Text>{text}</Text>
      </Card>
    </Layout>
  );
}
